import { Box, Typography } from "@mui/material";

import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        backgroundColor: "#EBF6F9",
        display: "flex",
        marginTop: "50px",
        padding: "40px",
        justifyContent: "space-between",
        paddingBottom: "40px",
        paddingTop: "40px",
        maxWidth: "100%",
      }}
    >
      <Box sx={{ paddingTop: "20px" }}>
        <Typography
          variant="h2"
          sx={{
            fontSize: "3rem",
            lineHeight: "3.5rem",
            width: "47rem",
            fontWeight: "700",
            textAlign: "left",
            marginBottom: "1rem",
            paddingTop: "20px",
          }}
        >
          Download the
          <span
            //   style={{
            //     color: "#3593B0",
            //     borderBottom: "3px solid rgb(0, 0, 0)",
            //     paddingBottom: "3px",
            //     fontWeight: "bolder",
            //   }}
            // >
            //   {" "}
            //   MyMoneyMantra{" "}

            style={{
              color: "#3593B0",
              fontWeight: "bolder",
              position: "relative", // Needed for absolute positioning of the underline
              paddingBottom: "4px",
              display: "inline-block",
              left:10
            }}
          >
            MyMoneyMantra
            <span
              style={{
                position: "absolute",
                bottom: 0,
                left: "20%", // Adjust this to move the line left/right
                width: "70%", // Adjust this for underline width
                height: "3px",
                backgroundColor: "black",
              }}
            ></span>
          </span>
          <br></br>
          Mobile App
        </Typography>

        <ul
          style={{
            textDecoration: "none",
            textAlign: "left",
            listStyleType: "none",
            padding: 0,
            margin: 0,
            paddingTop: "40px",
            paddingBottom: "40px",
          }}
        >
          <li
            style={{
              fontSize: "1.25rem",
              lineHeight: "1.75rem",
              fontWeight: "600",
              flexDirection: "row",
              marginleft: "0px",
              marginBottom: "2rem",
              fontFamily: "Manrope, sans-serif",
              gap: "0.75 rem",
            }}
          >
            <img src="/playstore/tick.jpg" alt="tick" /> Enjoy a seamless
            experience.
          </li>
          <li
            style={{
              fontSize: "1.25rem",
              lineHeight: "1.75rem",
              fontWeight: "600",
              flexDirection: "row",
              marginleft: "0px",
              marginBottom: "2rem",
              fontFamily: "Manrope, sans-serif",
              gap: "0.75 rem",
            }}
          >
            <img src="/playstore/tick.jpg" alt="tick" />
            Get exclusive Loans and Credit Card offers.
          </li>
          <li
            style={{
              fontSize: "1.25rem",
              lineHeight: "1.75rem",
              fontWeight: "600",
              flexDirection: "row",
              marginleft: "0px",
              marginBottom: "2rem",
              fontFamily: "Manrope, sans-serif",
              gap: "0.75 rem",
            }}
          >
            <img src="/playstore/tick.jpg" alt="tick" /> Track your credit score
            anytime anywhere.
          </li>
        </ul>

        <Box sx={{ display: "flex", gap: 10 }}>
          <img src="/playstore/pic1.jpg" alt="App store" />
          <img src="/playstore/pic2.jpg" alt="play store" />
        </Box>
      </Box>

      <Box sx={{ marginRight: "70px", padding: "25px" }}>
        <img src="/playstore/pic3.jpg" alt="Mobile" />
      </Box>
    </Box>
  );
}

export default PlayStore;
